void print_binary(int16 value, int16 bits);


void print_binary(int16 value, int16 bits) {
	int i = 0;

	printf("%5d: ", value);
	for (i = bits - 1; i >= 0; i--) {
		int bit = value & (1 << i);
		if (bit != 0) {
			printf("%d", 1);
		}
		else {
			printf("%d", 0);
		}
	}
	printf("\n");
}

