char mCompressedBinary_frame[1000] = { 0 };
static int16 decompressed_data_frame_last[MAX_TX * MAX_RX] = { 0 };
static int16 decompressed_data_frame_this[MAX_TX * MAX_RX] = { 0 };

void print_to_file(FILE* file, int16* data, int index, int length) {

	fprintf(file, "frame index: %d, compressed data length: %d\n", index, length);

	for (int i = 0; i < MAX_TX; i++) {
		for (int j = 0; j < MAX_RX; j++) {
			fprintf(file, "%6d, ", data[i * MAX_RX + j]);
		}
		fprintf(file, "\n");
	}

	fprintf(file, "\n\n\n");

	fflush(file);
}

