		if (file_lzw == NULL) {
			printf("decompress_LZW: failed to open file\n");
			return -1;
		}

		leftover = 0;

		//printf("***** Decompress Frame: %d\n", frameIndex);
		decompress_LZW(file_lzw, file, (char*) decompressed_data_frame_this, lzw_file_size);
		fclose(file_lzw);
