void verify_two_frames() {
	int frame_counts = sizeof(frameData) / sizeof(FrameData_t);

	int frameIndex = 0;

	FILE* file = fopen("two_frames_data.txt", "wb");
	if (file == NULL) {
		printf("failed to open file\n");
		return -1;
	}

	int maxLength = 0;
	int minLength = 2000;
	int sumLength = 0;
	int averageLength = 0;

	int length = compress_data_one_frame(frameData[0].raw, mCompressedBinary_frame, DATA_TYPE_RAW);
	get_decompress_data(mCompressedBinary_frame, length, decompressed_data_frame_last, NULL);

	print_to_file(file, decompressed_data_frame_last, 0, length);

	maxLength = minLength = length;
	sumLength += length;

	for (frameIndex = 1; frameIndex < frame_counts; frameIndex++) {

		memset16_local(mCompressedBinary_frame, 0, sizeof(mCompressedBinary_frame)/sizeof(uint16));
		memset16_local(decompressed_data_frame_this, 0, MAX_TX * MAX_RX);

		length = compress_data_two_continuous_frames(frameData[frameIndex - 1].raw, frameData[frameIndex].raw, mCompressedBinary_frame, DATA_TYPE_RAW);

		if (length >= maxLength) {
			maxLength = length;
		}

		if (length <= minLength) {
			minLength = length;
		}

		sumLength += length;

		get_decompress_data(mCompressedBinary_frame, length, decompressed_data_frame_this, decompressed_data_frame_last);

		print_to_file(file, decompressed_data_frame_this, frameIndex, length);

		memcpy16_local(decompressed_data_frame_last, decompressed_data_frame_this, MAX_TX * MAX_RX);
	}

	printf("summary of two frame compress: \n");
	printf("max compressed length: %d\n", maxLength);
	printf("min compressed length: %d\n", minLength);
	printf("avge compressed length: %d\n\n\n", sumLength / frame_counts);

	fclose(file);
}

